insert  into `news`(`id`,`title`,`details`,`published_dt`,`type`,`status`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (11,'Users Acceptance Testing (UAT) on DGDA website for the officials of DGDA was organized',' আজ বৃহস্পতিবার সকাল আটটার দিকে জকিগঞ্জের মির্জাচক হাওর থেকে বাহারকে \r\nপুলিশ গ্রেপ্তার করে। জকিগঞ্জ থানার ভারপ্রাপ্ত কর্মকর্তা (ওসি) হাবিবুর \r\nরহমান হাওলাদার এই তথ্য জানান।<br><br>গত রোববার বিকেলে কালীগঞ্জ বাজারের কাছে একই গ্রামের বখাটে বাহারের হাতে ছুরিকাহত হন ঝুমা।<br><br>ছুরিকাঘাতের ঘটনায় গত সোমবার ঝুমার পরিবার জকিগঞ্জ থানায় একটি মামলা করেছে।<br><br>মামলার আগে বাহারের বড় ভাই নাসির উদ্দিনকে আটক করে পুলিশ।','2016-09-18','news',1,1,1,'2017-01-19 10:55:08','2017-01-19 10:55:08');
